declare @idWF varchar(256)
declare @IdArticulo varchar(20)
DECLARE db_cursor CURSOR FOR select IdArticulo from Articulo where Cuit='27165995703' order by IdArticulo
OPEN db_cursor   
FETCH NEXT FROM db_cursor INTO @IdArticulo
WHILE @@FETCH_STATUS = 0   
BEGIN
	update Configuracion set @idWF=Valor=convert(varchar(256), convert(int, Valor)+1) where IdItemConfig='UltimoIdWF'
	update Articulo set IdWF=@IdWF where Cuit='27165995703' and IdArticulo=@IdArticulo
	insert Log values (@IdWF, getdate(), 'paretto', 'Articulo', 'Alta', 'Vigente', 'AUTOM')
	FETCH NEXT FROM db_cursor INTO @IdArticulo
END   
CLOSE db_cursor   
DEALLOCATE db_cursor
go
